let currentImage = 1;
const totalSwipes = 3;
const images = ["#image1", "#image2", "#image3"];
const cta = document.getElementById('cta');
const ctaContainer = document.querySelector('.cta-container'); 
const iconHeart = document.getElementById('icon-heart');
const iconX = document.getElementById('icon-x');
const bottomIcons = document.getElementById("bottom-icons")
const showMobileApp = document.getElementById("show-mobile-app")
const header = document.querySelector("header")
const headerImg = document.querySelector("header img")
const stores_icons = document.getElementById("stores_icons")
const closeButton = document.getElementById("close-button")


let xDown = null;
let xDiff = null;
let isDragging = false;

const imageSources = [
  	// First image 
	'data:image/png;base64,',

  	// Second image 
	'data:image/png;base64,', 

  	// Third image 
	'data:image/png;base64,', 
];



images.forEach((img, index) => {
	document.querySelector(img).style.backgroundImage = `url(${imageSources[index]})`;
	if (index > 0) {
	  document.querySelector(img).style.opacity = '0'; 
	  document.querySelector(img).style.display = 'none';
	}
});
  
document.addEventListener('touchstart', handleTouchStart, false);
document.addEventListener('touchmove', handleTouchMove, false);
document.addEventListener('touchend', handleTouchEnd, false);
  
function handleTouchStart(evt) {
	xDown = evt.touches[0].clientX;
	isDragging = true;
}
  
function handleTouchMove(evt) {
	if (!xDown || !isDragging) return;
  
	let xUp = evt.touches[0].clientX;
	xDiff = xUp - xDown;
  
	const currentImageEl = document.querySelector(images[currentImage - 1]);
	
	currentImageEl.style.transform = `translateX(${xDiff}px)`;
  
	if (xDiff > 0) {
	  	showIcon(iconHeart);
	  	hideIcon(iconX);
	} else {
	  	showIcon(iconX);
	  	hideIcon(iconHeart);
	}
}
  
function handleTouchEnd() {
	if (!xDown) return;
  
	const currentImageEl = document.querySelector(images[currentImage - 1]);
  
	const screenWidth = window.innerWidth;
	const threshold = 0.1 * screenWidth; 
  
	if (Math.abs(xDiff) > threshold) {
		if (xDiff > 0) {
			nextImage(); 
		} else {
			prevImage(); 
		}
	} else {
	  	resetImagePosition(currentImageEl); 
	}
  
	xDown = null;
	xDiff = null;
	isDragging = false;
	setTimeout(() => {
	  	hideIcon(iconHeart);
	  	hideIcon(iconX);
	}, 500);
  }
  
	function showIcon(icon) {
		icon.style.opacity = '1';
	}
  
	function hideIcon(icon) {
		icon.style.opacity = '0';
	}
  
  function nextImage() {
	if (currentImage < totalSwipes) {
		const currentImageEl = document.querySelector(images[currentImage - 1]);
		const nextImageEl = document.querySelector(images[currentImage]);
	
		currentImageEl.style.transition = 'transform 0.5s ease-out, opacity 0.5s ease-out';
		currentImageEl.style.transform = 'translateX(100%) rotate(20deg)'; 
		currentImageEl.style.opacity = '0';
  
		setTimeout(() => {
			currentImageEl.style.display = 'none'; 
			currentImage++; 
			nextImageEl.style.display = 'block'; 
			nextImageEl.style.opacity = '1';
			nextImageEl.style.transform = 'translateX(0) rotate(0deg)'; 
		}, 500);
	} else {
		showMockup()
	}
}
  
function prevImage() {
	if (currentImage < totalSwipes) {
		const currentImageEl = document.querySelector(images[currentImage - 1]);
		const nextImageEl = document.querySelector(images[currentImage]);
	
		currentImageEl.style.transition = 'transform 0.5s ease-out, opacity 0.5s ease-out';
		currentImageEl.style.transform = 'translateX(-100%) rotate(-20deg)';
		currentImageEl.style.opacity = '0';
  
		setTimeout(() => {
			currentImageEl.style.display = 'none'; 
			nextImageEl.style.display = 'block'; 
			nextImageEl.style.opacity = '1'; 
			nextImageEl.style.transform = 'translateX(0) rotate(0deg)'; 
			currentImage++; 
		}, 500);
	} else {
		showMockup()
	}
}
  
function resetImagePosition(currentImageEl) {
	currentImageEl.style.transition = 'transform 0.3s ease-out';
	currentImageEl.style.transform = 'translateX(0) rotate(0deg)';
}
  
function showEndCard() {
	cta.style.opacity = '1';
	header.style.top = '12%'
	headerImg.style.maxWidth = "36vh"
	stores_icons.style.display = "block"
	setTimeout(() => {
		stores_icons.style.opacity = "1"
	}, 0);
	launchConfetti();
  
	ctaContainer.addEventListener('click', function () {
		const userAgent = navigator.userAgent.toLowerCase();
	
		if (userAgent.includes('android')) {
			if (typeof mraid !== 'undefined' && mraid.open) {
				mraid.open('https://play.google.com/store/apps/details?id=com.tinder&hl=fr'); 
			} else {
				window.location.href = 'https://play.google.com/store/apps/details?id=com.tinder&hl=fr';
			}
		} else if (userAgent.includes('iphone') || userAgent.includes('ipad')) {
			if (typeof mraid !== 'undefined' && mraid.open) {
				mraid.open('https://apps.apple.com/fr/app/tinder-app-de-rencontre/id547702041'); 
			} else {
				window.location.href = 'https://apps.apple.com/fr/app/tinder-app-de-rencontre/id547702041'; 
			}
		} else {
			window.location.href = 'https://tinder.com'; 
		}
	});
}

function showMockup(){
	images.forEach(img => {
		document.querySelector(img).style.display = 'none';
	});
	bottomIcons.style.opacity = 0

	showMobileApp.style.display = "block"
	showMobileApp.style.opacity = "1"
	setTimeout(() => {
		showMobileApp.style.width = "100px"
		showMobileApp.style.height = "200px"
	}, 500);

	setTimeout(() => {
		showMobileApp.style.opacity = 0
	}, 2600);

	setTimeout(() => {
		showMobileApp.style.display = 'none'

		showEndCard()
	}, 3100);
}
  
if (typeof mraid !== 'undefined') {
	mraid.addEventListener('ready', function () {
	  	console.log("MRAID est prêt.");
	});
}

function launchConfetti() {
    const duration = 2 * 1000; 
    const animationEnd = Date.now() + duration;
    const defaults = { 
        spread: 360, 
        startVelocity: 30, 
        ticks: 100, 
		decay: 0.94,
		gravity: 0,
        zIndex: 0, 
        shapes: ["circle", "squere"] 
    };

    function randomInRange(min, max) {
        return Math.random() * (max - min) + min;
    }

    const interval = setInterval(function() {
        const timeLeft = animationEnd - Date.now();

        if (timeLeft <= 0) {
            return clearInterval(interval);
        }

        const particleCount = 50 * (timeLeft / duration);

        confetti(Object.assign({}, defaults, {
            particleCount,
            origin: { x: randomInRange(0.1, 0.3), y: Math.random() - 0.2 }
        }));

        confetti(Object.assign({}, defaults, {
            particleCount,
            origin: { x: randomInRange(0.7, 0.9), y: Math.random() - 0.2 }
        }));

        confetti(Object.assign({}, defaults, {
            particleCount: 20,
            scalar: 2, 
            shapes: ["text"], 
            shapeOptions: {
                text: {
                    value: ["❤️", "🍉", "🍇", "🍒"] 
                }
            },
            origin: { x: 0.5, y: 0.5 }
        }));
    }, 250);
}

const bottomHeart = document.getElementById('bottom-heart');
const bottomX = document.getElementById('bottom-x');

bottomHeart.addEventListener('click', () => {
    nextImage();
});

bottomX.addEventListener('click', () => {
    prevImage();
});

function showBottomIcons() {
    bottomHeart.style.opacity = '1';
    bottomX.style.opacity = '1';
}

setTimeout(() => {
    const closeButton = document.getElementById("close-button");
    closeButton.classList.add("active"); 
	
	closeButton.addEventListener('click', () => {
		alert("Closing ad...");
	});
  }, 10000);

showBottomIcons();
